        PLOT:\nMan takes advantage of people with selective amnesia.\n.\n.\n.\nLAZY
        REVIEW:\nYESTERDAY works primarily because The Beatles is so iconic, it turns
        even the silliest plots into gold. The story follows a struggling musician
        named Jack Malik, who wakes up after being hit by a bus learning that the
        world has no memory of the greatest band of all time. He then sings their
        songs and become famous, at the expense of the love of his life. Himesh Patel,
        who plays Jack Malik, is great at covering The Beatles, and I really felt
        the pain of going to choose between his priorities. There was a scene where
        he sang \u201cHelp!\u201d in front of a cheering crowd and he was literally
        screaming help because he wanted to get out of his situation. That part really
        struck a chord. But what really draws me to the story is the magnetic charm
        of Lily James. I loved her as Debra in Baby Driver and here she\u2019s just
        oozing with charisma that any guy would fall in love with her character. Ed
        Sheeran\u2019s inclusion in the movie gave the story the necessary foundation
        to elevate Jack Malik\u2019s rise to fame, while showing he\u2019s definitely
        one of the best musical composers of this generation. SNL\u2019s Kate McKinnon,
        always over-the-top with her performances, affirms that this tale is indeed
        a comedy. I was disappointed that all of Ana De Armas\u2019 scenes were cut
        in the film, as mentioned by director Danny Boyle, she was too good in it
        that it complicated the love story between Jack and Elly. Such a waste. YESTERDAY
